import React from 'react'
import NavBtn from './navBtn/NavBtn'
const NavBar = (props) => {
    const buttons = ["main","shops","cart"]
    
    return (

        
        <ul>
            {buttons.map(button =>{
                return(
                    <NavBtn name={button} />
                )
            })}    
        </ul>
    )
}
export default NavBar;
